--
-- Estructura para la vista `alumnos`
--
DROP TABLE IF EXISTS `alumnos`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `alumnos`  AS SELECT `c`.`DNI_cliente` AS `DNI_cliente`, concat(`c`.`Apellidos`,' ',`c`.`Nombres`) AS `concat(Apellidos," ",Nombres)`, year(curdate()) - year(`c`.`F_nacimiento`) AS `YEAR(CURDATE())-YEAR(C.F_nacimiento)`, `r`.`Peso` AS `Peso`, `r`.`Estatura` AS `Estatura`, `c`.`Nivel` AS `Nivel`, `m`.`Tipo_plan` AS `Tipo_plan`, `m`.`F_inicio` AS `F_inicio`, `c`.`Correo` AS `Correo`, `c`.`Teléfono` AS `Teléfono` FROM ((`cliente` `c` join `matricula` `m` on(`m`.`DNI_cliente` = `c`.`DNI_cliente`)) join `reporte_cliente` `r` on(`r`.`DNI_cliente` = `c`.`DNI_cliente`)) GROUP BY `c`.`DNI_cliente``DNI_cliente`  ;

-- --------------------------------------------------------

--
-- Estructura para la vista `datos_usuarios`
--
DROP TABLE IF EXISTS `datos_usuarios`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `datos_usuarios`  AS SELECT `u`.`DNI_cliente` AS `DNI`, `u`.`Nombres` AS `nombres`, `u`.`Apellidos` AS `apellidos`, `pu`.`perfil` AS `perfil`, `u`.`Estado` AS `Estado`, `u`.`correo` AS `correo`, `u`.`telefono` AS `telefono` FROM ((select `clientes`.`DNI_cliente` AS `DNI_cliente`,`clientes`.`Nombres` AS `Nombres`,`clientes`.`Apellidos` AS `Apellidos`,`clientes`.`Estado` AS `Estado`,`clientes`.`correo` AS `correo`,`clientes`.`telefono` AS `telefono` from (select `cliente`.`DNI_cliente` AS `DNI_cliente`,`cliente`.`Nombres` AS `Nombres`,`cliente`.`Apellidos` AS `Apellidos`,`cliente`.`Estado` AS `Estado`,`cliente`.`Correo` AS `correo`,`cliente`.`Teléfono` AS `telefono` from `cliente`) `clientes` union select `entrenadores`.`DNI_entrenador` AS `DNI_entrenador`,`entrenadores`.`Nombres` AS `Nombres`,`entrenadores`.`Apellidos` AS `Apellidos`,`entrenadores`.`Estado` AS `Estado`,`entrenadores`.`correo` AS `correo`,`entrenadores`.`telefono` AS `telefono` from (select `entrenador`.`DNI_entrenador` AS `DNI_entrenador`,`entrenador`.`Nombres` AS `Nombres`,`entrenador`.`Apellidos` AS `Apellidos`,`entrenador`.`Estado` AS `Estado`,`entrenador`.`Correo` AS `correo`,`entrenador`.`Teléfono` AS `telefono` from `entrenador`) `entrenadores`) `u` join `perfiles_usuario` `pu` on(`u`.`DNI_cliente` = `pu`.`DNI`))  ;

