--
-- Estructura para la vista `detalles_pagoentrenador`
--
DROP TABLE IF EXISTS `detalles_pagoentrenador`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `detalles_pagoentrenador`  AS SELECT `contrato`.`DNI_entrenador` AS `DNI_entrenador`, timestampdiff(MONTH,`contrato`.`F_inicio`,`contrato`.`F_final`) AS `meses`, `contrato`.`F_final` AS `F_final`, `contrato`.`sueldo` AS `sueldo` FROM `contrato``contrato`  ;

