--
-- Estructura para la vista `estado_cuentas`
--
DROP TABLE IF EXISTS `estado_cuentas`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `estado_cuentas`  AS SELECT (select `ingresos`.`ingreso` AS `iasdasd` from (select sum(`matricula`.`Pago`) AS `ingreso` from `matricula`) `ingresos`) AS `Ingresos`, (select `egresos`.`egreso` AS `iasdasd` from (select sum(`contrato`.`sueldo`) AS `egreso` from `contrato`) `egresos`) AS `Egresos``Egresos`  ;

