--
-- Estructura para la vista `perfiles_usuario`
--
DROP TABLE IF EXISTS `perfiles_usuario`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `perfiles_usuario`  AS SELECT `administrador`.`DNI_administrador` AS `DNI`, `administrador`.`Contraseña` AS `password`, 'administrador' AS `perfil` FROM `administrador` union select `cliente`.`DNI_cliente` AS `DNI_cliente`,`cliente`.`Contraseña` AS `Contraseña`,'usuario' AS `usuario` from `cliente` union select `entrenador`.`DNI_entrenador` AS `DNI_entrenador`,`entrenador`.`Contraseña` AS `Contraseña`,'entrenador' AS `entrenador` from `entrenador`  ;

